0px;">...</span> by species and measured all fish lengths at MaxN. This data 
holding contains: The exported files from Eventmeasure for all 87 stations 
(3DPoints, ImagePtPair, Info, Lengths, MovieSeq, Period, Points and Source); 
Metadata for each deployment as a csv file (including station summary 
statistic of: Number of taxa, total MaxN, diversity metrics, biomass and 
cluster groups; and a GIS shapefile containing the same summary information.
